export class Hero {
    name: string = "";
    height: string = "";
    origin: string = "";
    skills: Array<string> = [];
    constructor(Iname: string = "", Iheight: string = "", Iorigin: string = "", Iskills: string[] = []){
            this.name = Iname;
            this.height = Iheight;
            this.origin = Iorigin;
            this.skills = Iskills;
    }
}
